import React from "react";
import {
  BrowserRouter,
  Route,
  withRouter,
  Link,
  useHistory,
} from "react-router-dom";
import logo from "./images/Logo.png";
import { axiosWithAuth } from "./Components/axiosWithAuth";
import { getId } from "./actions/postActions";
import { connect } from "react-redux";
import Home from './images/Home.png'
const Nav = (props) => {
  const Logout = () => {
    axiosWithAuth()
      .patch(`/player/{ _id: ${props.One._id}, __v: 0 }`, CredOff)
      .then(window.localStorage.setItem("token", ""));
  };

  const CredOff = {
    Status: "offline",
  };

  return (
    <div>
      <BrowserRouter>
        <nav>
          <div className="navCont">
            <div className="logo-cont">
              <img src={logo} className="logo" /> <h1> Team Finder</h1>
            </div>
<svg xmlns="http://www.w3.org/2000/svg" class="icon icon-tabler icon-tabler-user" width="44" height="44" viewBox="0 0 24 24" stroke-width="1.5" stroke="#2c3e50" fill="none" stroke-linecap="round" stroke-linejoin="round">
  <path stroke="none" d="M0 0h24v24H0z" fill="none"/>
  <circle cx="12" cy="7" r="4" />
  <path d="M6 21v-2a4 4 0 0 1 4 -4h4a4 4 0 0 1 4 4v2" />
</svg>
         <a href="/"> Home </a>
            {/* <Link to = {( `/myPlayer/${props.One._id}`)}>My Player</Link> */}
            <a href={`/myPlayer/${props.One._id}`}> My Player</a>
            
            <a href="/find"> Explore </a>
            <a href="/login" onClick={Logout}>
              {" "}
              Logout{" "}
            </a>
          </div>
        </nav>
      </BrowserRouter>
    </div>
  );
};

const mapStateToProps = (state) => ({
  One: state.getId.UserId,
});

export default connect(mapStateToProps, { getId })(Nav);
